module.exports={1:"Start by pushing the tiles to one corner of the square. Placing tiles together in one corner gives you a higher chance to move tiles with the same number closer together. You can use one of the four corners of the box, top left, top right, bottom left, and bottom right. The square at the edge of the corner you chose should contain the highest number so it won’t get in your way while you combine other tiles.",2:"Never place tiles with high numbers in the center of the box. Doing so will make it harder for you to combine other tiles because your tile with a higher number on it will block other tiles with lower numbers that are appearing.",3:"Start with the tiles with small numbers on them. Let the tiles with high numbers on them stay in one corner while you are combining the tiles with smaller numbers. Then the score will increase as time passes by.",4:"Use the boxes that are seen beside the corner you are using to keep the tile with the highest number in order to make it easier to combine them together.",5:"Don’t rush in combining tiles with high values. This might scatter the tiles you are keeping aside and make it harder to combine a lot of tiles. Keep combining squares with small values until you reach your goal.",6:"Practice a lot. Experience is one of the greatest mentors one can have. Playing the game a lot will give you a lot of practice and it will allow you to develop different strategies for how to achieve high scores. Be patient and let your experience take you to greater achievements in game."};
